      "instructions": [
          {
              "display_text": "Add water, oil, sugar, and salt into a saucepan and bring to a boil. Whisk until combined. Take off heat once combined.",
              "position": 1,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56333
          },
          {
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56334,
              "display_text": "Add flour and mix with a wooden spatula until dough forms. Let cool.",
              "position": 2,
              "start_time": 0
          },
          {
              "display_text": "Beat an egg into the dough mixture thoroughly.",
              "position": 3,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56335
          },
          {
              "appliance": null,
              "id": 56336,
              "display_text": "Fill dough into a pastry bag with a star tip or into a zipper storage bag with the corner tip cut off.",
              "position": 4,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "appliance": null,
              "id": 56337,
              "display_text": "Squeeze dough into hot oil and cut off about every 3-4 inches. Fry until golden-brown, about 6 minutes. Immediately place into the cinnamon sugar mixture.",
              "position": 5,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "id": 56338,
              "display_text": "For chocolate sauce, combine cocoa powder, sugar, salt, vanilla, and water in a saucepan. Bring to a boil whisking constantly. Let cool.",
              "position": 6,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "id": 56339,
              "display_text": "Enjoy!",
              "position": 7,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          }
      ],
