      "instructions": [
          {
              "id": 56307,
              "display_text": "Cut each eggplant in half. Once halved, carefully hollow out each eggplant by slicing the interior flesh of the eggplant into medium-sized cubes.",
              "position": 1,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "appliance": null,
              "id": 56308,
              "display_text": "Once cubed, use a spoon to gently remove each cube — then use the spoon to hollow out the remainder of the eggplant. (Tip: Ensure you hollow out the interior of each eggplant, without slicing off the top or bottom of the eggplant itself. You essentially want to make a boat out of your eggplant).",
              "position": 2,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "temperature": null,
              "appliance": null,
              "id": 56310,
              "display_text": "Place the removed flesh of the eggplant into a food processor. Then, add each ingredient into the food processor with the removed eggplant flesh.",
              "position": 3,
              "start_time": 0,
              "end_time": 0
          },
          {
              "display_text": "Process all ingredients into a stuffing consistency, which generally requires about 5–8 medium/long pulses (make sure you still have texture: don’t process into a paste).",
              "position": 4,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56311
          },
          {
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56312,
              "display_text": "Add 2 tbsp extra-virgin olive oil to a cast-iron skillet or frying span. Heat on medium and add the stuffing from the food processor to the pan.",
              "position": 5
          },
          {
              "appliance": null,
              "id": 56313,
              "display_text": "Spoon the stuffing you’ve made in the food processor into the frying pan and saute on a medium-low flame for approximately 8–10 minutes. Once this is done cooking, allow to cool for 10 minutes.",
              "position": 6,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "id": 56314,
              "display_text": "Place your hollowed out eggplant onto a baking sheet that has been lightly greased with extra virgin olive oil. Brush the eggplant with olive oil and season with salt and pepper.",
              "position": 7,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "id": 56315,
              "display_text": "Once seasoned, spoon the finished stuffing into each eggplant, until full but not overflowing. Top each eggplant with shredded mozzarella and 2 tbsp of marinara sauce.",
              "position": 8,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "id": 56316,
              "display_text": "Next, add 2 heaping tablespoons of chicken stock and 2 heaping tbsp of Pinot Grigio to the base of the pan, underneath each eggplant.",
              "position": 9,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "appliance": null,
              "id": 56317,
              "display_text": "Place into a 425 °F for 25–30 Minutes or until the eggplants have cooked down and develop a well-roasted skin.",
              "position": 10,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "position": 11,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56318,
              "display_text": "When nearly finished, place the eggplants under a low broiler for 10 minutes, until golden-brown and bubbly."
          },
          {
              "display_text": "Garnish with a little more fresh basil, parsley and grated Parmesan cheese and serve.",
              "position": 12,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56319
          },
          {
              "appliance": null,
              "id": 56385,
              "display_text": "Enjoy!",
              "position": 13,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          }
      ],
