      "instructions": [
          {
              "display_text": "Heat oil in a pan and add cinnamon stick, cardamom, and cumin seeds. Let roast and, after a few seconds, add finely chopped onions and salt and saute until golden.",
              "position": 1,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56294
          },
          {
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56295,
              "display_text": "Once the onions are golden and tender, add the masalas (spices) as follows: ginger-garlic paste, turmeric powder, cumin powder, garam masala, coriander powder, red chili",
              "position": 2,
              "start_time": 0
          },
          {
              "position": 3,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56296,
              "display_text": "powder, green chilies, and curry leaves. Mix all the ingredients well and then add"
          },
          {
              "temperature": null,
              "appliance": null,
              "id": 56297,
              "display_text": "chopped tomato, and a little bit of water (¼ cup) and cook until everything turns soft (5-6 minutes). You can also add ¼ cup (65 G) tomato paste in place of the 1 tomato to get a very smooth gravy.",
              "position": 4,
              "start_time": 0,
              "end_time": 0
          },
          {
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56298,
              "display_text": "Once the oil starts to separate, add the cleaned and sliced mushrooms and mix them well with the masala mixture. Cook for 3-4 minutes. Then, add ¼ cup (or slightly more) required water and cook until the mushrooms are fully done. You should have a gravy-esque consistency: something that can be mixed with rice or accompanied by naan or roti or an equivalent flatbread.",
              "position": 5,
              "start_time": 0
          },
          {
              "appliance": null,
              "id": 56299,
              "display_text": "Finally, garnish with chopped coriander leaves and turn off the heat. If desired, add 1 tsp of ghee on the top to enhance the flavor.",
              "position": 6,
              "start_time": 0,
              "end_time": 0,
              "temperature": null
          },
          {
              "id": 56300,
              "display_text": "Serve with rice or naan.",
              "position": 7,
              "start_time": 0,
              "end_time": 0,
              "temperature": null,
              "appliance": null
          },
          {
              "end_time": 0,
              "temperature": null,
              "appliance": null,
              "id": 56384,
              "display_text": "Enjoy!",
              "position": 8,
              "start_time": 0
          }
      ],
