              "video_url": "https://vid.tasty.co/output/31957/low_1495124967.m3u8",
              "total_time_minutes": null,
              "instructions": [
                  {
                      "display_text": "In a large pot over medium-low heat, heat olive oil and add butter. Once the butter is melted, stir the onions and coat with oil and butter.",
                      "position": 1,
                      "start_time": 1000,
                      "end_time": 4367,
                      "temperature": null,
                      "appliance": null,
                      "id": 2479
                  },
                  {
                      "id": 2480,
                      "display_text": "Cover and cook for 20 minutes, checking occasionally.",
                      "position": 2,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "position": 3,
                      "start_time": 7167,
                      "end_time": 11517,
                      "temperature": null,
                      "appliance": null,
                      "id": 2481,
                      "display_text": "Turn up the heat to medium-high. Add ½ tsp salt and sugar. Stir and keep cooking until onions are brown and caramelized. (the bottom of the pan will develop some browning, it’s very important!)"
                  },
                  {
                      "display_text": "Stir in flour one tablespoon at a time and cook for about 30 seconds.",
                      "position": 4,
                      "start_time": 12517,
                      "end_time": 15667,
                      "temperature": null,
                      "appliance": null,
                      "id": 2482
                  },
                  {
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": 325,
                      "appliance": "oven",
                      "id": 2478,
                      "display_text": "Preheat Oven To 325˚F (160˚C).",
                      "position": 5
                  },
                  {
                      "start_time": 16667,
                      "end_time": 18617,
                      "temperature": null,
                      "appliance": null,
                      "id": 2483,
                      "display_text": "Add 1 cup (235 ml) of the beef broth. Use a whisk to scrape up (deglaze) the browned bits stuck on the bottom of the pan.",
                      "position": 6
                  },
                  {
                      "display_text": "Add the remaining five cups of beef stock, wine, sage and bay leaf. Bring to a boil. Reduce heat and simmer, uncovered, for 40 minutes.",
                      "position": 7,
                      "start_time": 19617,
                      "end_time": 31467,
                      "temperature": null,
                      "appliance": null,
                      "id": 2484
                  },
                  {
                      "start_time": 35016,
                      "end_time": 40567,
                      "temperature": 325,
                      "appliance": "oven",
                      "id": 2485,
                      "display_text": "In the meantime, cut the french bread or baguette into ½ inch (10 mm) thick pieces. Brush with oil on both sides and bake at 325˚F (160˚C) for 30 minutes, flipping halfway. Once they are done, increase oven temperature to 350˚F (175˚C).",
                      "position": 8
                  },
                  {
                      "temperature": null,
                      "appliance": null,
                      "id": 9565,
                      "display_text": "Add optional ingredients.",
                      "position": 9,
                      "start_time": 44417,
                      "end_time": 54017
                  },
                  {
                      "id": 2486,
                      "display_text": "In an oven safe bowl, pour the onion soup, filling about ¾ of the way full. Top with a piece of baked french bread, and generously sprinkle swiss and parmesan on top.",
                      "position": 10,
                      "start_time": 56000,
                      "end_time": 59650,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 2487,
                      "display_text": "Bake for two to three minutes or until the cheese has melted completely and become slightly golden.",
                      "position": 11,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 2488,
                      "display_text": "Enjoy!",
                      "position": 12,
                      "start_time": 65833,
                      "end_time": 67266,
                      "temperature": null,
                      "appliance": null
                  }
              ],
