              "instructions": [
                  {
                      "position": 1,
                      "start_time": 1166,
                      "end_time": 3317,
                      "temperature": null,
                      "appliance": null,
                      "id": 739,
                      "display_text": "Lay 3 slices of bacon on a greased pan."
                  },
                  {
                      "display_text": "Bake for 20 minutes at 400°F (200°C), flip once halfway through.",
                      "position": 2,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null,
                      "id": 8537
                  },
                  {
                      "id": 8535,
                      "display_text": "Dab off any extra oil and brush maple syrup on both sides of the bacon.",
                      "position": 3,
                      "start_time": 7567,
                      "end_time": 11467,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 8538,
                      "display_text": "Bake for an additional 3-5 minutes (until the bacon is crispy).",
                      "position": 4,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "end_time": 19367,
                      "temperature": null,
                      "appliance": null,
                      "id": 8536,
                      "display_text": "Cut up the bacon into small pieces and set aside for garnishing the soup later.",
                      "position": 5,
                      "start_time": 17317
                  },
                  {
                      "id": 740,
                      "display_text": "Melt 1 Tbsp. of butter. Add in the onion, stir, and cook on medium heat until fragrant.",
                      "position": 6,
                      "start_time": 20967,
                      "end_time": 29067,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "start_time": 29467,
                      "end_time": 44167,
                      "temperature": null,
                      "appliance": null,
                      "id": 8539,
                      "display_text": "Add in the sweet potatoes, chicken broth, and spices. Cover and bring to a boil.",
                      "position": 7
                  },
                  {
                      "temperature": null,
                      "appliance": null,
                      "id": 8540,
                      "display_text": "Let simmer for 15-20 minutes until the potatoes have softened. Add 2 tbsp of maple syrup and stir.",
                      "position": 8,
                      "start_time": 45000,
                      "end_time": 55000
                  },
                  {
                      "appliance": null,
                      "id": 8541,
                      "display_text": "Then blend with an immersion blender or transfer to a blender and blend in batches until smooth and well-combined.",
                      "position": 9,
                      "start_time": 56667,
                      "end_time": 61367,
                      "temperature": null
                  },
                  {
                      "id": 8542,
                      "display_text": "Serve up and garnish with heavy cream (optional), the maple bacon, and a sprinkle of cinnamon (optional).",
                      "position": 10,
                      "start_time": 62367,
                      "end_time": 70350,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 8543,
                      "display_text": "Enjoy!",
                      "position": 11,
                      "start_time": 71633,
                      "end_time": 74983,
                      "temperature": null,
                      "appliance": null
                  }
              ],
