              "instructions": [
                  {
                      "display_text": "In a small mixing bowl, combine flour, baking powder, and salt with a spatula. Form a well in the middle of the dry mixture and add 2 tablespoons olive oil and warm water. Mix until dough forms in to a sticky ball. Cover with a dish towel and set aside.",
                      "position": 1,
                      "start_time": 64000,
                      "end_time": 77000,
                      "temperature": null,
                      "appliance": null,
                      "id": 29872
                  },
                  {
                      "display_text": "In large pot or Dutch oven, add the olive oil over medium heat. Once the oil begins to shimmer, add the onion and carrot and cook for about 4-5 minutes, or until the onions are semi-translucent.",
                      "position": 2,
                      "start_time": 79000,
                      "end_time": 84500,
                      "temperature": null,
                      "appliance": null,
                      "id": 29873
                  },
                  {
                      "end_time": 95333,
                      "temperature": null,
                      "appliance": null,
                      "id": 29874,
                      "display_text": "Add in the garlic, dill, sage, thyme, and pepper, and cook for 2-3 more minutes until herbs are fragrant.",
                      "position": 3,
                      "start_time": 86000
                  },
                  {
                      "position": 4,
                      "start_time": 96000,
                      "end_time": 108500,
                      "temperature": null,
                      "appliance": null,
                      "id": 29875,
                      "display_text": "Stir in potatoes, vegetable broth, and bay leaves, and bring to a boil. 5. Reduce heat to medium-high and simmer about 8 minutes or until potatoes are about 75 percent cooked through."
                  },
                  {
                      "display_text": "Carefully drop in dollops of the dumpling dough, about 1 inch (2-cm) in diameter.",
                      "position": 5,
                      "start_time": 110000,
                      "end_time": 116833,
                      "temperature": null,
                      "appliance": null,
                      "id": 29876
                  },
                  {
                      "id": 29877,
                      "display_text": "Let dumplings simmer for about 10 minutes, or until chewy and cooked through.",
                      "position": 6,
                      "start_time": 118000,
                      "end_time": 121000,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "appliance": null,
                      "id": 29878,
                      "display_text": "To serve, garnish with lots of fresh parsley.",
                      "position": 7,
                      "start_time": 121500,
                      "end_time": 133666,
                      "temperature": null
                  },
                  {
                      "end_time": 136666,
                      "temperature": null,
                      "appliance": null,
                      "id": 29879,
                      "display_text": "Enjoy!",
                      "position": 8,
                      "start_time": 134166
                  }
              ],
