              "canonical_id": "recipe:5155",
              "brand_id": null,
              "country": "US",
              "is_shoppable": true,
              "num_servings": 8,
              "servings_noun_plural": "servings",
              "show_id": 17,
              "yields": "Servings: 8-10",
              "instructions": [
                  {
                      "id": 46970,
                      "display_text": "Add the onion, garlic, jalapeño, chipotle peppers, cilantro, and tomatoes to a food processor. Puree until well combined, with no large pieces remaining, about 2 minutes. Set aside.",
                      "position": 1,
                      "start_time": 6166,
                      "end_time": 19000,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 46971,
                      "display_text": "Season the chicken thighs on both sides with salt and the oregano.",
                      "position": 2,
                      "start_time": 22000,
                      "end_time": 32333,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "display_text": "In a large pot, heat 1 tablespoon of olive oil over medium-high heat. Sear the chicken thighs for 4-5 minutes on each side, until golden brown. Transfer to a cutting board. Shred the chicken using 2 forks. Set aside.",
                      "position": 3,
                      "start_time": 34000,
                      "end_time": 64000,
                      "temperature": null,
                      "appliance": null,
                      "id": 46972
                  },
                  {
                      "id": 46973,
                      "display_text": "Add the remaining tablespoon of olive oil to the same pot if it appears dry. Pour the reserved puree into the pot. Cook over medium-high heat for 10 minutes, until the liquid has started to evaporate. Reduce the heat to medium and continue cooking until nearly all the moisture has been cooked out and the puree has reduced to a dark paste, stirring occasionally to prevent burning, about 20 minutes.",
                      "position": 4,
                      "start_time": 68166,
                      "end_time": 81666,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "display_text": "Pour in the chicken stock and stir, scraping the bottom of the pan to incorporate any browned bits. Increase the heat to medium-high. Stir in the shredded chicken and bring to a simmer.",
                      "position": 5,
                      "start_time": 82000,
                      "end_time": 95833,
                      "temperature": null,
                      "appliance": null,
                      "id": 46974
                  },
                  {
                      "id": 46975,
                      "display_text": "Once the stock is simmering, stir in the hominy and bell pepper. Reduce the heat to medium and simmer for 5-10 minutes to allow the flavors to meld. Add the lime juice and season with salt to taste.",
                      "position": 6,
                      "start_time": 97000,
                      "end_time": 120666,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "end_time": 135833,
                      "temperature": null,
                      "appliance": null,
                      "id": 46976,
                      "display_text": "Serve the soup hot, with onion, cilantro, avocado, cotija cheese, tortilla strips, and lime wedges alongside for topping.",
                      "position": 7,
                      "start_time": 124000
                  },
                  {
                      "start_time": 138000,
                      "end_time": 147333,
                      "temperature": null,
                      "appliance": null,
                      "id": 46977,
                      "display_text": "Enjoy!",
                      "position": 8
                  }
              ],
              "aspect_ratio": "1:1",
