              "instructions": [
                  {
                      "temperature": null,
                      "appliance": null,
                      "id": 56244,
                      "display_text": "In a large bowl, whisk together the brownie mix, flour, and baking powder.",
                      "position": 1,
                      "start_time": 76000,
                      "end_time": 84166
                  },
                  {
                      "id": 56245,
                      "display_text": "In a medium bowl, whisk together the milk, melted butter, and egg yolks.",
                      "position": 2,
                      "start_time": 86000,
                      "end_time": 94500,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 56246,
                      "display_text": "Pour the wet ingredients into the dry ingredients and whisk until just combined. Add the egg whites and whisk until just combined, but do not overmix.",
                      "position": 3,
                      "start_time": 96000,
                      "end_time": 109000,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 56247,
                      "display_text": "Let the batter sit for 15 minutes to thicken.",
                      "position": 4,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "id": 56248,
                      "display_text": "Heat a large nonstick pan over medium-low heat. Add about ¼ cup of batter to the pan. Cook the pancake for 3–4 minutes, until bubbles start to appear on the surface. Flip the pancake and cook for another 2–3 minutes, until cooked through. Repeat with the remaining batter.",
                      "position": 5,
                      "start_time": 117000,
                      "end_time": 131166,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "temperature": null,
                      "appliance": null,
                      "id": 56249,
                      "display_text": "Stack the pancakes on a plate and top with chocolate syrup, strawberries, and whipped cream.",
                      "position": 6,
                      "start_time": 132000,
                      "end_time": 145833
                  },
                  {
                      "end_time": 151500,
                      "temperature": null,
                      "appliance": null,
                      "id": 56250,
                      "display_text": "Enjoy!",
                      "position": 7,
                      "start_time": 147000
                  }
              ],
