      "brand_id": null,
      "description": "Turn a box of brownie mix into soft, chewy, and decadent cookies with a caramel surprise hidden inside.",
      "is_shoppable": true,
      "brand": null,
      "instructions": [
          {
              "id": 56238,
              "display_text": "Preheat the oven to 350°F (180°C). Line 2 baking sheets with a nonstick baking mat or parchment paper.",
              "position": 1,
              "start_time": 0,
              "end_time": 0,
              "temperature": 350,
              "appliance": "oven"
          },
          {
              "id": 56239,
              "display_text": "In a large bowl, whisk together the brownie mix, baking powder, and flour. Add the vegetable oil and eggs and beat with an electric hand mixer until well combined.",
              "position": 2,
              "start_time": 160000,
              "end_time": 177500,
              "temperature": null,
              "appliance": null
          },
          {
              "display_text": "Scoop out 2 tablespoons of the dough and flatten into a disc. Add a caramel candy to the center and roll the dough around it to cover. Place on a prepared baking sheet and repeat with the remaining dough and candies, spacing the cookies evenly.",
              "position": 3,
              "start_time": 180000,
              "end_time": 210666,
              "temperature": null,
              "appliance": null,
              "id": 56240
          },
          {
              "appliance": null,
              "id": 56241,
              "display_text": "Bake the cookies for 10–12 minutes, until crispy on the edges and crinkly on top. Remove from the oven and sprinkle with flaky sea salt while still hot. Let cool on the baking sheets for 2 minutes, then transfer to a wire rack.",
              "position": 4,
              "start_time": 212000,
              "end_time": 235000,
              "temperature": null
          },
          {
              "id": 56242,
              "display_text": "Enjoy!",
              "position": 5,
              "start_time": 241000,
              "end_time": 248000,
              "temperature": null,
              "appliance": null
          }
      ],
