      "instructions": [
          {
              "end_time": 271000,
              "temperature": null,
              "appliance": null,
              "id": 56220,
              "display_text": "Add 24 chocolate sandwich cookies to the bowl of a food processor. Pulse until broken down into fine crumbs. Transfer to a large bowl and add the melted butter. Stir until well combined and the consistency resembles wet sand.",
              "position": 1,
              "start_time": 252000
          },
          {
              "temperature": null,
              "appliance": null,
              "id": 56221,
              "display_text": "Transfer the crust mixture to a 9-inch springform pan and firmly pat down in an even layer.",
              "position": 2,
              "start_time": 272000,
              "end_time": 279500
          },
          {
              "id": 56222,
              "display_text": "Add the brownie mix to a large, heat-proof bowl. Microwave for 2 minutes, stirring every 30 seconds, until the internal temperature reaches 165°F (75°C). This will help kill any harmful bacteria. Set aside.",
              "position": 3,
              "start_time": 285000,
              "end_time": 300000,
              "temperature": null,
              "appliance": null
          },
          {
              "id": 56223,
              "display_text": "Add the cream cheese to a separate large bowl and beat with an electric hand mixer on medium-high speed for 2–3 minutes, until light and fluffy. Scrape down the sides of the bowl. Add the powdered sugar, vanilla, heavy cream, and sour cream and beat until the filling is smooth, about 2 minutes, scraping down the sides of the bowl as needed.",
              "position": 4,
              "start_time": 303000,
              "end_time": 324833,
              "temperature": null,
              "appliance": null
          },
          {
              "start_time": 326000,
              "end_time": 335000,
              "temperature": null,
              "appliance": null,
              "id": 56224,
              "display_text": "Gradually add the brownie mix and beat on low speed until fully incorporated and smooth, 1–2 minutes, scraping down the sides of the bowl as needed.",
              "position": 5
          },
          {
              "display_text": "Pour the filling over the crust and smooth the top. Cover with plastic wrap and refrigerate for at least 6 hours, or ideally overnight, until the filling is set.",
              "position": 6,
              "start_time": 336000,
              "end_time": 344000,
              "temperature": null,
              "appliance": null,
              "id": 56225
          },
          {
              "end_time": 354333,
              "temperature": null,
              "appliance": null,
              "id": 56226,
              "display_text": "Remove the cheesecake from the fridge, unwrap, and release the springform. Transfer to a serving plate and garnish with whipped cream and the 8 halved chocolate sandwich cookies.",
              "position": 7,
              "start_time": 345000
          },
          {
              "id": 56227,
              "display_text": "Slice and serve. Leftover cheesecake will keep in the refrigerator for 2–3 days.",
              "position": 8,
              "start_time": 357000,
              "end_time": 362000,
              "temperature": null,
              "appliance": null
          },
          {
              "end_time": 368166,
              "temperature": null,
              "appliance": null,
              "id": 56228,
              "display_text": "Enjoy!",
              "position": 9,
              "start_time": 364000
          }
      ],
