              "instructions": [
                  {
                      "end_time": 0,
                      "temperature": 350,
                      "appliance": "oven",
                      "id": 54170,
                      "display_text": "Preheat the oven to 350°F (180°C). Grease 2 6-donut pans with nonstick spray.",
                      "position": 1,
                      "start_time": 0
                  },
                  {
                      "id": 54171,
                      "display_text": "In a medium bowl, whisk together the flour, sugar, salt, baking soda, and cocoa powder.",
                      "position": 2,
                      "start_time": 5333,
                      "end_time": 18000,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "display_text": "In a large bowl, whisk together the vegetable oil, milk, egg, egg yolk, vanilla, and apple cider vinegar.",
                      "position": 3,
                      "start_time": 20000,
                      "end_time": 35000,
                      "temperature": null,
                      "appliance": null,
                      "id": 54172
                  },
                  {
                      "id": 54173,
                      "display_text": "Gradually add the dry ingredients to the wet ingredients, whisking to incorporate the first addition then switching to a rubber spatula. Add the fuschia and deep pink food coloring and fold to incorporate, being careful not to overmix.",
                      "position": 4,
                      "start_time": 38000,
                      "end_time": 74000,
                      "temperature": null,
                      "appliance": null
                  },
                  {
                      "end_time": 86000,
                      "temperature": null,
                      "appliance": null,
                      "id": 54174,
                      "display_text": "Transfer the batter to a resealable zip-top bag with a corner snipped off or a piping bag fitted with a large round tip. Pipe the batter into the prepared donut pans, filling each mold halfway.",
                      "position": 5,
                      "start_time": 75000
                  },
                  {
                      "display_text": "Bake the donuts for 8–10 minutes, or until the edges begin to brown slightly. Remove from the oven and let cool completely in the pans on a wire rack before removing.",
                      "position": 6,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null,
                      "id": 54175
                  },
                  {
                      "start_time": 89000,
                      "end_time": 112000,
                      "temperature": null,
                      "appliance": null,
                      "id": 54176,
                      "display_text": "While the donuts cool, make the frosting: In a medium bowl, combine the powdered sugar, cream cheese, and butter. Beat with an electric hand mixer starting on low speed until fully combined, gradually increasing the mixer speed as the powdered sugar is incorporated. Add the heavy cream and vanilla and beat until smooth, about 1 minute. The frosting will keep in an airtight container in the refrigerator for up to 1 week. Bring to room temperature before using.",
                      "position": 7
                  },
                  {
                      "position": 8,
                      "start_time": 0,
                      "end_time": 0,
                      "temperature": null,
                      "appliance": null,
                      "id": 54177,
                      "display_text": "Remove 2 donuts from the pans and crumble by hand."
                  },
                  {
                      "end_time": 123833,
                      "temperature": null,
                      "appliance": null,
                      "id": 54178,
                      "display_text": "Frost the remaining donuts and top with the donut crumbs.",
                      "position": 9,
                      "start_time": 115000
                  },
                  {
                      "appliance": null,
                      "id": 54179,
                      "display_text": "Enjoy!",
                      "position": 10,
                      "start_time": 125000,
                      "end_time": 127166,
                      "temperature": null
                  }
              ],
